webpackJsonp([52938120389206],{319:function(a,e){a.exports={data:{markdownRemark:{html:'<p>There are several instances where one may want to route traffic to a specific\ndomain through a certain WAN connection. One use case I recently encountered is\nwhen your country\'s IP is blocked for a specific site. It\'s a relatively simple\nprocess, and can be a really powerful tool when managing a network. Here\'s the\nsteps:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/step1-5d89664d206094d1078dffc49fae88b0-99e46.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 980px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 62.5%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Step 1"\n        title=""\n        src="/static/step1-5d89664d206094d1078dffc49fae88b0-7df03.png"\n        srcset="/static/step1-5d89664d206094d1078dffc49fae88b0-c0982.png 245w,\n/static/step1-5d89664d206094d1078dffc49fae88b0-732b3.png 490w,\n/static/step1-5d89664d206094d1078dffc49fae88b0-7df03.png 980w,\n/static/step1-5d89664d206094d1078dffc49fae88b0-c2fda.png 1470w,\n/static/step1-5d89664d206094d1078dffc49fae88b0-3c743.png 1960w,\n/static/step1-5d89664d206094d1078dffc49fae88b0-99e46.png 2880w"\n        sizes="(max-width: 980px) 100vw, 980px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \nFirstly, we\'ll open up the network preferences  </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/step2-f3516b475dbfaa92d59b866e36399fbe-99e46.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 980px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 62.5%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Step 2"\n        title=""\n        src="/static/step2-f3516b475dbfaa92d59b866e36399fbe-7df03.png"\n        srcset="/static/step2-f3516b475dbfaa92d59b866e36399fbe-c0982.png 245w,\n/static/step2-f3516b475dbfaa92d59b866e36399fbe-732b3.png 490w,\n/static/step2-f3516b475dbfaa92d59b866e36399fbe-7df03.png 980w,\n/static/step2-f3516b475dbfaa92d59b866e36399fbe-c2fda.png 1470w,\n/static/step2-f3516b475dbfaa92d59b866e36399fbe-3c743.png 1960w,\n/static/step2-f3516b475dbfaa92d59b866e36399fbe-99e46.png 2880w"\n        sizes="(max-width: 980px) 100vw, 980px"\n      />\n    </span>\n  </span>\n  \n  </a>\n     Then, navigate to the outbound policy page. When\noutbound policy is set to custom, this page will list any specific\ntraffic-routing rules you have set up. If it is not set to custom, go ahead and\nset it now.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/step3-b6032dbb3bb54488dea3168ea2605ca8-99e46.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 980px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 62.5%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Step 3"\n        title=""\n        src="/static/step3-b6032dbb3bb54488dea3168ea2605ca8-7df03.png"\n        srcset="/static/step3-b6032dbb3bb54488dea3168ea2605ca8-c0982.png 245w,\n/static/step3-b6032dbb3bb54488dea3168ea2605ca8-732b3.png 490w,\n/static/step3-b6032dbb3bb54488dea3168ea2605ca8-7df03.png 980w,\n/static/step3-b6032dbb3bb54488dea3168ea2605ca8-c2fda.png 1470w,\n/static/step3-b6032dbb3bb54488dea3168ea2605ca8-3c743.png 1960w,\n/static/step3-b6032dbb3bb54488dea3168ea2605ca8-99e46.png 2880w"\n        sizes="(max-width: 980px) 100vw, 980px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \nScroll the whole way to the bottom of the list, then add a new rule</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/step4-11684fd4c4137b742984ca050bc3a3ae-99e46.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 980px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 62.5%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Step 4"\n        title=""\n        src="/static/step4-11684fd4c4137b742984ca050bc3a3ae-7df03.png"\n        srcset="/static/step4-11684fd4c4137b742984ca050bc3a3ae-c0982.png 245w,\n/static/step4-11684fd4c4137b742984ca050bc3a3ae-732b3.png 490w,\n/static/step4-11684fd4c4137b742984ca050bc3a3ae-7df03.png 980w,\n/static/step4-11684fd4c4137b742984ca050bc3a3ae-c2fda.png 1470w,\n/static/step4-11684fd4c4137b742984ca050bc3a3ae-3c743.png 1960w,\n/static/step4-11684fd4c4137b742984ca050bc3a3ae-99e46.png 2880w"\n        sizes="(max-width: 980px) 100vw, 980px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \nGo ahead and name the rule something recognizable so you will know what it is for in the future. To filter by domain, Adjust the "Destination" section accordingly, then enter your domain name. Wildcards are also supported. for more information, click the <code>?</code> button. Choose an appropriate algorithm for routing your traffic. Typically, enforced will be the most applicable, but <a href="https://www.peplink.com/technology/load-balancing-algorithms/">other options</a> are available. </p>\n<p>When you are finished with the configuration, save your changes.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/step5-ba37537263e1e257ca502a6434b8d199-99e46.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 980px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 62.5%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Step 5"\n        title=""\n        src="/static/step5-ba37537263e1e257ca502a6434b8d199-7df03.png"\n        srcset="/static/step5-ba37537263e1e257ca502a6434b8d199-c0982.png 245w,\n/static/step5-ba37537263e1e257ca502a6434b8d199-732b3.png 490w,\n/static/step5-ba37537263e1e257ca502a6434b8d199-7df03.png 980w,\n/static/step5-ba37537263e1e257ca502a6434b8d199-c2fda.png 1470w,\n/static/step5-ba37537263e1e257ca502a6434b8d199-3c743.png 1960w,\n/static/step5-ba37537263e1e257ca502a6434b8d199-99e46.png 2880w"\n        sizes="(max-width: 980px) 100vw, 980px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/step6-deca79025972422c894aa64eb89e07cc-99e46.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 980px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 62.5%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="step6"\n        title=""\n        src="/static/step6-deca79025972422c894aa64eb89e07cc-7df03.png"\n        srcset="/static/step6-deca79025972422c894aa64eb89e07cc-c0982.png 245w,\n/static/step6-deca79025972422c894aa64eb89e07cc-732b3.png 490w,\n/static/step6-deca79025972422c894aa64eb89e07cc-7df03.png 980w,\n/static/step6-deca79025972422c894aa64eb89e07cc-c2fda.png 1470w,\n/static/step6-deca79025972422c894aa64eb89e07cc-3c743.png 1960w,\n/static/step6-deca79025972422c894aa64eb89e07cc-99e46.png 2880w"\n        sizes="(max-width: 980px) 100vw, 980px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \nYour now rule will be placed at the top of the list. The filters will be applied from the top down, so if you want other rules to be higher-priority (for VoIP maybe?), drag your new rule down below them. </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/step7-66667689ee709b42f0e7a3b7192985b7-99e46.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 980px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 62.5%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Step 7"\n        title=""\n        src="/static/step7-66667689ee709b42f0e7a3b7192985b7-7df03.png"\n        srcset="/static/step7-66667689ee709b42f0e7a3b7192985b7-c0982.png 245w,\n/static/step7-66667689ee709b42f0e7a3b7192985b7-732b3.png 490w,\n/static/step7-66667689ee709b42f0e7a3b7192985b7-7df03.png 980w,\n/static/step7-66667689ee709b42f0e7a3b7192985b7-c2fda.png 1470w,\n/static/step7-66667689ee709b42f0e7a3b7192985b7-3c743.png 1960w,\n/static/step7-66667689ee709b42f0e7a3b7192985b7-99e46.png 2880w"\n        sizes="(max-width: 980px) 100vw, 980px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \nNow, click the apply changes button to finalize your changes. The traffic to your specified domain should now be using the algorithm you configured. Go ahead and and give it a test!</p>',frontmatter:{date:"January 31, 2018",path:"/routing-traffic-per-domain-peplink-router",title:"Routing traffic per-domain with a Peplink Router"}}},pathContext:{}}}});
